import React from 'react';

class SoloContent extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {

        if (this.props.visible === true && this.props.pageNum === 1) {
            return (
                    <div id="contentContainer">
                        <div className="contentCanvas">
                            <ul id="soloProList">
                                <li id="soloPro1"></li>
                                <li id="soloPro1"></li>
                                <li id="soloPro1"></li>
                            </ul>
                        </div>
                        <style jsx>{`
                            #contentContainer {
                                position: absolute;
                                left: 50%;
                                top: 50%;
                                transform: translate(-50%, -50%);
                                height: 60vh;
                                width: 80vw;
                                background-image: url('data:image/png;base64,');
                                background-color: rgb(192,192,192);
                                border-radius: 8px;
                              }
                            
                              .contentCanvas {
                                height: 100%;
                                z-index: 15;
                              }
                            
                              #soloProList {
                                list-style-type: none;
                                font-size: 1.6em;
                            
                                width: 100%;
                                transform: translate(-5.3%, 11%);
                              }
                            
                              #soloPro1 {
                                margin: 0 0 10% 0;
                              }
                        `}</style>
                    </div>
            )} else if (this.props.visible === true && this.props.pageNum === 2) {
                return (
                    <div id="contentContainer">
                        <div className="contentCanvas">
                            <ul id="soloProList">
                                <li id="soloPro1">Small lot assays ranging from 10-10,000Lbs</li>
                                <li id="soloPro1">Detailed invoicing reflecting current PGM market values</li>
                                <li id="soloPro1">Fast order grading and processing with multiple payment options</li>
                            </ul>
                        </div>
                        <style jsx>{`
                            #contentContainer {
                                position: absolute;
                                left: 50%;
                                top: 50%;
                                transform: translate(-50%, -50%);
                                height: 60vh;
                                width: 80vw;
                                background-image: url('data:image/png;base64,');
                                background-color: rgb(192,192,192);
                                border-radius: 8px;
                              }
                            
                              .contentCanvas {
                                margin: auto;
                                z-index: 15;
                              }
                            
                              #soloProList {
                                list-style-type: none;
                                font-size: 1.6em;
                            
                                width: 100%;
                                transform: translate(-5.3%, 11%);
                              }
                            
                              #soloPro1 {
                                margin: 0 0 10% 0;
                              }
                        `}</style>
                    </div>
            )} else if (this.props.visible === true && this.props.pageNum === 3) {
                return (
                    <div id="contentContainer">
                        <div className="contentCanvas">
                            <ul id="soloProList">
                                <li id="soloPro1">Never getting a finite price from a buying app, taking risks buying on a range</li>
                                <li id="soloPro1">Always carrying the risk of loss when buying unknown pieces</li>
                                <li id="soloPro1">Manually keeping track of everything you've purchased</li>
                            </ul>
                        </div>
                        <style jsx>{`
                            #contentContainer {
                                position: absolute;
                                left: 50%;
                                top: 50%;
                                transform: translate(-50%, -50%);
                                height: 60vh;
                                width: 80vw;
                                background-image: url('data:image/png;base64,');
                                background-color: rgb(192,192,192);
                                border-radius: 8px;
                              }
                            
                              .contentCanvas {
                                margin: auto;
                                z-index: 15;
                              }
                            
                              #soloProList {
                                list-style-type: none;
                                font-size: 1.6em;
                            
                                width: 100%;
                                transform: translate(-5.3%, 11%);
                              }
                            
                              #soloPro1 {
                                margin: 0 0 10% 0;
                              }
                        `}</style>
                    </div>
            )} else {
                return (null)
            };
    }
}

export default SoloContent;
